import DataTable from 'react-data-table-component';

export function Accounts (){

    const columns = [
        {
            name: 'Title',
            selector: row => row.title,
        },
        {
            name: 'Year',
            selector: row => row.year,
        },
    ];

    const data = [
        {
            id: 1,
            title: 'Beetlejuice',
            year: '1988',
        },
        {
            id: 2,
            title: 'Ghostbusters',
            year: '1984',
        },
    ]

    function MyComponent() {
        return (
            <DataTable
                columns={columns}
                data={data}
            />
        );
    };

    return (
        <div>

        </div>
    )
}
